import { useState } from "react"

interface IProps{
    
    id:string,
    name:string,
    team:string

}[]

const ProjectList=(props:any)=>{
  const [dataDUMY,setdataDUMY]=useState([])
setdataDUMY(props.onProps);
return (
    <ul>
    <div>{props.dataDUMY.map((item:any)=>{
     <li key={item.id}>{item.name},{item.team}
</li>
    })}</div>
    </ul>
)
}

export default ProjectList
